import React from 'react';

import { Link } from 'react-router-dom';
import { render } from '@testing-library/react';


class Navbar extends React.Component{
    render(){
        return(
            <nav id="menu" >
                <ul>
                    <Link to="/portfolio" className="menu-links" data-menuanchor="about">About</Link>
                    <Link to="/projects" className="menu-links" data-menuanchor="about">About</Link>
                    <Link to="/contact" className="menu-links" data-menuanchor="about">About</Link>                
                </ul>
            </nav>
        )
    }
}
export default Navbar
